import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';
import AppNavbar from './components/AppNavbar'
import ShopingList from './components/ShoppingList'
function App() {
  return (
    <div className="App">
      <AppNavbar />
      <ShopingList />
    </div>
  );
}

export default App;
